import React, {Component} from 'react';
import Todo from "../Todo/Todo";

class List extends Component {
    render() {
        return (
            <div>
                <Todo/>
                <Todo/>
                <Todo/>
                <Todo/>
            </div>
        );
    }
}

export default List;
